rdamer('pi').variables()).toEqual([]);\r\n        expect(nerdamer(core.Settings.IMAGINARY).variables()).toEqual([]);\r\n    });\r\n    /** #44: a+b - (a+b) not evaluated as 0 */\r\n    it('should perform subtraction of terms', function () {\r\n      // given\r\n      var formula = 'a+b - (a+b)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      expect(result).toBe('0');\r\n    });\r\n    /** #46: (x^(1/2)*x^(1/3))-x^(5/6) should be 0 */\r\n    it('should result in 0', function () {\r\n      // given\r\n      var formula = '(x^(1/2)*x^(1/3))-x^(5/6)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      expect(result).toBe('0');\r\n    });\r\n    /** #47: (a^2)/(a*b) should be a/b */\r\n    it('should simplify correctly', function () {\r\n      // given\r\n      var formula = '(a^2)/(a*b)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      // TODO jiggzson: Result is correct but a/b would be simpler\r\n      expect(result).toBe('a*b^(-1)');\r\n    });\r\n    /** #56: x/sqrt(x) = x^(3/2) */\r\n    it('should calculate x/sqrt(x) correctly', function () {\r\n      // given\r\n      var formula = 'x/sqrt(x)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      expect(result).toBe('x^(1/2)');\r\n    });   \r\n    /** #60: sin(x) looks like sin(abs(x)) */\r\n    it('should respect the sign of argument for sin(x)', function () {\r\n      // given\r\n      var halfSqrt2 = '0.7071067811865475'; // sqrt(2)/2\r\n      var halfSqrt3 = '0.8660254037844385'; // sqrt(3)/2\r\n      var testCases = [\r\n        {\r\n          given: '-pi',\r\n          expected: '0'\r\n        },\r\n        {\r\n          given: '-3/4*pi',\r\n          expected: '-' + halfSqrt2\r\n        },\r\n        {\r\n          given: '-2/3*pi',\r\n          expected: '-' + halfSqrt3\r\n        },\r\n given: 'asech(3*i+5)',\r\n                expected: '-1.4237901324243494*i+0.08907951708807783'\r\n            },\r\n            {\r\n                given: 'acsch(3*i+5)',\r\n                expected: '-0.08740053182394636*i+0.14709131539545411'\r\n            },\r\n            {\r\n                given: 'acoth(3*i+5)',\r\n                expected: '-0.08992674989623915*i+0.14694666622552965'\r\n            }\r\n        ];\r\n        \r\n        for (var i = 0; i <"+" testCases.length; ++i) {\r\n            var result = nerdamer(testCases[i].given, null, 'numer').text();\r\n            expect(round(result, 14)).toEqual(round(testCases[i].expected),14);\r\n      }\r\n    });\r\n    it('should correctly get the numerator', function() {\r\n        var testCases = [\r\n            {\r\n                given: '3/4*a',\r\n                expected: '3*a'\r\n            },\r\n            {\r\n                given: '8*a*b/(x*(x+1))',\r\n                expected: '8*a*b'\r\n            },\r\n            {\r\n                given: 'x+1/x',\r\n                expected: 'x+x^(-1)'\r\n            },\r\n            {\r\n                given: 'a*b/x',\r\n                expected: 'a*b'\r\n            },\r\n            {\r\n                given: 'x^2/(2*x+2)',\r\n                expected: 'x^2'\r\n            },\r\n            {\r\n                given: '1/3*x^2/(2*x+2)',\r\n                expected: 'x^2'\r\n            },\r\n            {\r\n                given: '2/a',\r\n                expected: '2'\r\n            },\r\n        ];\r\n        \r\n        for (var i = 0; i <"+" testCases.length; ++i) {\r\n            var result = nerdamer(testCases[i].given).numerator().text();\r\n            expect(result.toString()).toEqual(testCases[i].expected);\r\n      }\r\n    });   \r\n    it('should correctly get the denominator', function() {\r\n        var testCases = [\r\n            {\r\n                given: '3/4*a',\r\n                expected: '4'\r\n            },\r\n            {\r\n                given: '8*a*b/(x*(x+1))',\r\n                expected: '(1+x)*x'\r\n            },\r\n            {\r\n                given: 'x+1/x',\r\n                expected: '1'\r\n            },\r\n            {\r\n                given: 'a*b/x',\r\n                expected: 'x'\r\n            },\r\n            {\r\n                given: 'x^2/(2*x+2)',\r\n                expected: '2+2*x'\r\n            },\r\n            {\r\n                given: '1/3*x^2/(2*x+2)',\r\n                expected: '3*(2+2*x)'\r\n            },\r\n            {\r\n                given: '2/a',\r\n                expected: 'a'\r\n            },\r\n        ];\r\n        \r\n        for (var i = 0; i <"+" testCases.length; ++i) {\r\n            var result = nerdamer(testCases[i].given).denominator().text();\r\n            expect(result.toString()).toEqual(testCases[i].expected);\r\n      }\r\n    });\r\n    it('should add vectors correctly', function() {\r\n        expect(nerdamer('1+[a,b]').toString()).toEqual('[1+a,1+b]');\r\n        expect(nerdamer('[a,b]+1').toString()).toEqual('[1+a,1+b]');\r\n        expect(nerdamer('[a,b]+[a,b]').toString()).toEqual('[2*a,2*b]');\r\n    });\r\n    it('should subtract vectors correctly', function() {\r\n        expect(nerdamer('1-[a,b]').toString()).toEqual('[-a+1,-b+1]');\r\n        expect(nerdamer('[a,b]-1').toString()).toEqual('[-1+a,-1+b]');\r\n        expect(nerdamer('[a,b]-[a,b]').toString()).toEqual('[0,0]');\r\n    });\r\n    it('should multiply vectors correctly', function() {\r\n        expect(nerdamer('3*[a,b]').toString()).toEqual('[3*a,3*b]');\r\n        expect(nerdamer('[a,b]*x').toString()).toEqual('[a*x,b*x]');\r\n        expect(nerdamer('[a,b]*[a,b]').toString()).toEqual('[a^2,b^2]');\r\n    });\r\n    it('should divide vectors correctly', function() {\r\n        expect(nerdamer('12/[3,4]').toString()).toEqual('[4,3]');\r\n        expect(nerdamer('[21,15]/3').toString()).toEqual('[7,5]');\r\n        expect(nerdamer('[a^2, b^2]/[a,b]').toString()).toEqual('[a,b]');\r\n    });\r\n    it('should get slices correctly', function() {\r\n        expect(nerdamer('[1,2,3][0:2]').toString()).toEqual('[1,2]');\r\n    });\r\n    it('should get elements correctly', function() {\r\n        expect(nerdamer('[1,2,3][1]').toString()).toEqual('2');\r\n    });\r\n    it('should remove near duplicates from vectors', function() {\r\n        expect(nerdamer('vectrim([cos(0), 1, 1.000000000000001])').toString()).toEqual('[1]');\r\n        expect(nerdamer('vectrim([cos(0), 1, 1.000000000000001], 0)').text()).toEqual('[1,1.000000000000001]');\r\n    });\r\n    it('should convert degrees to radians', function() {\r\n        expect(nerdamer('radians(45)').toString()).toEqual('(1/4)*pi');\r\n    });\r\n    it('should convert radians to degrees', function() {\r\n        expect(nerdamer('degrees(pi/4)').toString()).toEqual('45');\r\n    });\r\n    it('should rationalize correctly', function() {\r\n        expect(nerdamer('rationalize(a/b+c/d+e/f)').toString()).toEqual('(a*d*f+b*c*f+b*d*e)*(b*d*f)^(-1)');\r\n        expect(nerdamer('rationalize(1/x+x)').toString()).toEqual('(1+x^2)*x^(-1)');\r\n        expect(nerdamer('rationalize((x+1)/x-1)').toString()).toEqual('x^(-1)');\r\n        expect(nerdamer('rationalize((a*x^2+b)/x^2-1)').toString()).toEqual('(-x^2+a*x^2+b)*x^(-2)');\r\n    });\r\n    it('should handle matrix operations', function() {\r\n        expect(nerdamer('matrix([3,4])^2').toString()).toEqual('matrix([9,16])');\r\n        expect(nerdamer('2^matrix([3,4])').toString()).toEqual('matrix([8,16])');\r\n        expect(nerdamer('2^matrix([3,4])').toString()).toEqual('matrix([8,16])');\r\n        expect(nerdamer('2*matrix([3,4])').toString()).toEqual('matrix([6,8])');\r\n        expect(nerdamer('matrix([1,2])+matrix([8,4])').toString()).toEqual('matrix([9,6])');\r\n        expect(nerdamer('2+matrix([3,4])').toString()).toEqual('matrix([5,6])');\r\n        expect(nerdamer('2-matrix([3,4])').toString()).toEqual('matrix([-1,-2])');\r\n        expect(nerdamer('matrix([1,2])-matrix([8,4])').toString()).toEqual('matrix([-7,-2])');\r\n        expect(nerdamer('matrix([3,4])-2').toString()).toEqual('matrix([1,2])');\r\n        expect(nerdamer('matrix([8,4])/2').toString()).toEqual('matrix([4,2])');\r\n        expect(nerdamer('matrix([1,2])/matrix([8,4])').toString()).toEqual('matrix([1/8,1/2])');\r\n        expect(nerdamer('16/matrix([8,4])').toString()).toEqual('matrix([2,4])');\r\n    });\r\n    it('should perform scientific rounding', function() {\r\n        expect(nerdamer('12/7*x+cos(33333333333333333)-11/17').text('scientific')).toEqual('-6.47058823529412e-1+1.71428571428571*x+cos(3.33333333333333e16)');\r\n        expect(nerdamer('7/(11*x-24*x^2)+cos(13/44)^(300/21)').text('scientific')).toEqual('7*(-2.4e1*x^2+1.1e1*x)^(-1)+cos(2.95454545454545e-1)^1.42857142857143e1');\r\n    });\r\n    it('should throw for even negative powers in nthroots', function() {\r\n        expect(function() {nerdamer('nthroot(-9, 2)').evaluate(); }).toThrowError();\r\n    });\r\n    it('should throw for zero powers in nthroots', function() {\r\n        expect(function() {nerdamer('nthroot(-9, 0)').evaluate(); }).toThrowError();\r\n    });\r\n    it('should calculate nthroots', function() {\r\n        expect(nerdamer('nthroot(-8, 3)').evaluate().text()).toEqual('-2');\r\n        expect(nerdamer('nthroot(sqrt(64), sqrt(9))').evaluate().text()).toEqual('2');\r\n        expect(nerdamer('nthroot(-1, 3)').evaluate().text()).toEqual('-1');\r\n        expect(nerdamer('nthroot(-7, 3)').evaluate().text()).toEqual('-1.912931182772388873');\r\n        expect(nerdamer('nthroot(-x*8, 3)').evaluate().text()).toEqual('nthroot(-8*x,3)');\r\n    });\r\n    it('should calculate cube roots', function () {\r\n        expect(nerdamer('cbrt(8)').evaluate().text()).toEqual('2');\r\n        expect(nerdamer('cbrt(x)').evaluate().text()).toEqual('cbrt(x)');\r\n        expect(nerdamer('cbrt(27*x^3)').evaluate().text()).toEqual('3*x');\r\n        expect(nerdamer('cbrt((y^3*x^3))').evaluate().text()).toEqual('x*y');\r\n    });\r\n    it('should correctly build a JS function', function () {\r\n        expect(nerdamer('acos((-x)^(1/6))').buildFunction()(0)).toEqual(1.5707963267948966);\r\n        //factorials\r\n        expect(nerdamer('x^2+x!').buildFunction()(4)).toEqual(40);\r\n    });\r\n    it('should correctly build for a nerdamer defined function', function () {\r\n        //Note: this may break at some point when big numbers are implemented \r\n        expect(nerdamer('Ci(x)+x').buildFunction()(4)).toEqual(3.8590183021130704);\r\n    });\r\n    it('should handle nested functions', function() {\r\n        nerdamer.setFunction(\"a\", [\"x\"], \"2*x\")\r\n        nerdamer.setFunction(\"b\", [\"x\"], \"x^2\")\r\n\r\n        expect(nerdamer(\"a(b(x))\").text()).toEqual('2*x^2');\r\n    });\r\n    it('should handle percent', function() {\r\n        expect(nerdamer('10%+20%').toString()).toEqual('3/10');\r\n        expect(nerdamer('a%/10%').toString()).toEqual('(1/10)*a');\r\n        expect(nerdamer('x%-x%').toString()).toEqual('0');\r\n        expect(nerdamer('x%*x%').toString()).toEqual('(1/10000)*x^2');\r\n    });\r\n    it('should recognize the mod and percent operator', function() {\r\n        expect(nerdamer('3*(a%%b%)').toString()).toEqual('3*mod((1/100)*a,(1/100)*b)')\r\n    });\r\n    it('should rewrite e as exp', function() {\r\n        block('E_TO_EXP', function() {\r\n            expect(nerdamer('(3*e^(e^(x))+tan(-e^x))+a').toString()).toEqual('3*exp(exp(x))+a+tan(-exp(x))');\r\n        });\r\n    });\r\n    it('should unwrap even abs', function() {\r\n        expect(nerdamer('(3*abs(x))^2').toString()).toEqual('3*x^2');\r\n    });\r\n});\r\n\r\ndescribe('Further arithmetic test cases', function () {\r\n    it('Batch 1', function () {\r\n        // given\r\n        var testCases = [\r\n            {\r\n                given: '(x+x^2)+x',\r\n                ex n":38,"line":272},"start":{"column":8,"line":272}}},{"id":"693","mutatorName":"StringLiteral","replacement":"\"\"","status":"Timeout","static":true,"coveredBy":[],"location":{"end":{"column":36,"line":282},"start":{"column":8,"line":282}}}],"source":"/* global expect */\r\n\r\n'use strict';\r\n\r\nvar nerdamer = require('../nerdamer.core.js');\r\nrequire('../Algebra.js');\r\n\r\ndescribe('Algebra', function () {\r\n    it('should perform gcd operations correctly', function () {\r\n        expect(nerdamer('gcd(5*x^6+5*x^5+27*x^4+27*x^3+28*x^2+28*x, 5*x^3+7*x)').toString()).toEqual('5*x^3+7*x');\r\n        expect(nerdamer('gcd(-20+16*i,-10+8*i)').toString()).toEqual('-10+8*i');\r\n        expect(nerdamer('gcd(2*x^2+2*x+1,x+1)').toString()).toEqual('1');\r\n        expect(nerdamer('gcd(x^2+2*x+1,x+1)').toString()).toEqual('1+x');\r\n        expect(nerdamer('gcd(6*x^9+24*x^8+15*x^7+6*x^2+24*x+15, (2*x^2+8*x+5))').toString()).toEqual('2*x^2+8*x+5');\r\n        expect(nerdamer('gcd(x^8+4*x^7+4*x^6+3*x^5+12*x^4+12*x^3, (x^3+3))').toString()).toEqual('3+x^3');\r\n        expect(nerdamer('gcd(6*x^9+24*x^8+15*x^7+6*x^2+24*x+15, x^7+1)').toString()).toEqual('1+x^7');\r\n        expect(nerdamer('gcd(1+x^2,2*x)').toString()).toEqual('1');\r\n        expect(nerdamer('gcd(84*x^4+147*x^3+16*x^2+28*x, 44*x^5+77*x^4+16*x^3+28*x^2+12*x+21)').toString()).toEqual('4*x+7');\r\n        expect(nerdamer('gcd(5*x^11+90*x^9+361*x^7+473*x^5+72*x^3+91*x, 7150*x^12+9360*x^10+1375*x^9+1430*x^8+37550*x^7+1872*x^6+47075*x^5+7510*x^3+9360*x)').toString()).toEqual('5*x^5+x');\r\n        expect(nerdamer('gcd(7*x^4+7*x^3+4*x^2+5*x+1, 21*x^6+47*x^4+80*x^3+20*x^2+49*x+11)').toString()).toEqual('1+4*x+7*x^3');\r\n        expect(nerdamer('gcd(5*x^11+90*x^9+361*x^7+473*x^5+72*x^3+91*x, 7150*x^12+9360*x^10+1375*x^9+1430*x^8+37550*x^7+1872*x^6+47075*x^5+7510*x^3+9360*x,x)').toString()).toEqual('x');\r\n        expect(nerdamer('gcd(x^8+4*x^7+4*x^6+3*x^5+12*x^4+12*x^3, (x^3+3), 3+x^3)').toString()).toEqual('3+x^3');\r\n        expect(nerdamer('gcd(a, b, c)').toString()).toEqual('gcd(a,b,c)');\r\n        expect(nerdamer('gcd(18,12, 6)').toString()).toEqual('6');\r\n        expect(nerdamer('gcd(3, 5, 7)').toString()).toEqual('1');\r\n        expect(nerdamer('gcd(1/2, 1/3, 1/4)').toString()).toEqual('1/12');\r\n        expect(nerdamer('gcd(5%, 15%, 25%)').toString()).toEqual('1/20');\r\n        expect(nerdamer('gcd(1/a, 1/b, 1/c)').toString()).toEqual('gcd(a^(-1),b^(-1),c^(-1))');\r\n        expect(nerdamer('gcd(2^x, 6^x)').toString()).toEqual('2^x');\r\n        expect(nerdamer('gcd(a, b, c, gcd(x, y, z, gcd(f,gcd(g,h))))').toString()).toEqual('gcd(a,b,c,x,y,z,f,g,h)');\r\n        expect(nerdamer('gcd(2^x, 6^x)').toString()).toEqual('2^x');\r\n        expect(nerdamer('gcd(a,a,b,b,gcd(c,c))').toString()).toEqual('1');\r\n        expect(nerdamer('gcd(a,a)').toString()).toEqual('a');\r\n        expect(nerdamer('gcd(a^b,a^c)').toString()).toEqual('a');\r\n        expect(nerdamer('gcd(a^c,b^c)').toString()).toEqual('1');\r\n        expect(nerdamer('gcd(a^a,a^a)').toString()).toEqual('a^a');\r\n    });\r\n    \r\n    it('should perform lcm operations correctly', function () {\r\n        expect(nerdamer('lcm(5*x^6+5*x^5+27*x^4+27*x^3+28*x^2+28*x, 5*x^3+7*x)').toString()).toEqual('27*x^3+27*x^4+28*x+28*x^2+5*x^5+5*x^6');\r\n        expect(nerdamer('lcm(-20+16*i,-10+8*i)').toString()).toEqual('-10+8*i');\r\n        expect(nerdamer('lcm(2*x^2+2*x+1,x+1)').toString()).toEqual('(1+2*x+2*x^2)*(1+x)');\r\n        expect(nerdamer('lcm(x^2+2*x+1,x+1)').toString()).toEqual('1+2*x+x^2');\r\n        expect(nerdamer('lcm(6*x^9+24*x^8+15*x^7+6*x^2+24*x+15, (2*x^2+8*x+5))').toString()).toEqual('15+15*x^7+24*x+24*x^8+6*x^2+6*x^9');\r\n        expect(nerdamer('lcm(x^8+4*x^7+4*x^6+3*x^5+12*x^4+12*x^3, (x^3+3))').toString()).toEqual('12*x^3+12*x^4+3*x^5+4*x^6+4*x^7+x^8');\r\n        expect(nerdamer('lcm(6*x^9+24*x^8+15*x^7+6*x^2+24*x+15, x^7+1)').toString()).toEqual('15+15*x^7+24*x+24*x^8+6*x^2+6*x^9');\r\n        expect(nerdamer('lcm(1+x^2,2*x)').toString()).toEqual('2*(1+x^2)*x');\r\n        expect(nerdamer('lcm(84*x^4+147*x^3+16*x^2+28*x, 44*x^5+77*x^4+16*x^3+28*x^2+12*x+21)').toString()).toEqual('(12*x+16*x^3+28*x^2+44*x^5+77*x^4+21)*(147*x^3+16*x^2+28*x+84*x^4)*(4*x+7)^(-1)');\r\n        expect(nerdamer('lcm(5*x^11+90*x^9+361*x^7+473*x^5+72*x^3+91*x, 7150*x^12+9360*x^10+1375*x^9+1430*x^8+37550*x^7+1872*x^6+47075*x^5+7510*x^3+9360*x)').toString()).toEqual('(1375*x^9+1430*x^8+1872*x^6+37550*x^7+47075*x^5+7150*x^12+7510*x^3+9360*x+9360*x^10)*(361*x^7+473*x^5+5*x^11+72*x^3+90*x^9+91*x)*(5*x^5+x)^(-1)');\r\n        expect(nerdamer('lcm(7*x^4+7*x^3+4*x^2+5*x+1, 21*x^6+47*x^4+80*x^3+20*x^2+49*x+11)').toString()).toEqual('(1+4*x+7*x^3)^(-1)*(1+4*x^2+5*x+7*x^3+7*x^4)*(11+20*x^2+21*x^6+47*x^4+49*x+80*x^3)');\r\n        expect(nerdamer('lcm(5*x^11+90*x^9+361*x^7+473*x^5+72*x^3+91*x, 7150*x^12+9360*x^10+1375*x^9+1430*x^8+37550*x^7+1872*x^6+47075*x^5+7510*x^3+9360*x,x)').toString()).toEqual('(1375*x^9+1430*x^8+1872*x^6+37550*x^7+47075*x^5+7150*x^12+7510*x^3+9360*x+9360*x^10)*(361*x^7+473*x^5+5*x^11+72*x^3+90*x^9+91*x)*(5*x^6+x^2)^(-1)*x');\r\n        expect(nerdamer('lcm(x^8+4*x^7+4*x^6+3*x^5+12*x^4+12*x^3, (x^3+3), 3+x^3)').toString()).toEqual('(12*x^3+12*x^4+3*x^5+4*x^6+4*x^7+x^8)*(3+x^3)^2*(6*x^3+x^6+9)^(-1)');\r\n        expect(nerdamer('lcm(a, b, c)').toString()).toEqual('a*b*c*gcd(a*b,a*c,b*c)^(-1)');\r\n        expect(nerdamer('lcm(18,12, 6)').toString()).toEqual('36');\r\n        expect(nerdamer('lcm(3, 5, 7)').toString()).toEqual('105');\r\n        expect(nerdamer('lcm(1/2, 1/3, 1/4)').toString()).toEqual('1');\r\n        expect(nerdamer('lcm(5%, 15%, 25%)').toString()).toEqual('3/4');\r\n        expect(nerdamer('lcm(1/a, 1/b, 1/c)').toString()).toEqual('1');\r\n        expect(nerdamer('lcm(2^x, 6^x)').toString()).toEqual('6^x');\r\n        expect(nerdamer('lcm(a, b, c, gcd(x, y, z, gcd(f,gcd(g,h))))').toString()).toEqual('a*b*c*gcd(x,y,z,f,g,h)');\r\n        expect(nerdamer('lcm(2^x, 6^x)').toString()).toEqual('6^x');\r\n        expect(nerdamer('lcm(a,a,b,b,gcd(c,c))').toString()).toEqual('a^2*b^2*c*gcd(a^2*b^2,a^2*b*c,a^2*b*c,a*b^2*c,a*b^2*c)^(-1)');\r\n        expect(nerdamer('lcm(a,a)').toString()).toEqual('a^2*gcd(a,a)^(-1)');\r\n        expect(nerdamer('lcm(a^b,a^c)').toString()).toEqual('a^(-1+b+c)');\r\n        expect(nerdamer('lcm(a^c,b^c)').toString()).toEqual('a^c*b^c');\r\n        expect(nerdamer('lcm(a^a,a^a)').toString()).toEqual('a^a');\r\n    });\r\n    \r\n    describe('isPoly', function () {\r\n        it('should detect polynomials', function () {\r\n            expect(nerdamer('51').symbol.isPoly(true)).toEqual(true);\r\n            expect(nerdamer('x^2+1').symbol.isPoly(true)).toEqual(true);\r\n            expect(nerdamer('51/x').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('x^2+1/x').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('y*x^2+1/x').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('y*x^2+x').symbol.isPoly(true)).toEqual(true);\r\n            expect(nerdamer('7*y*x^2+z*x+4').symbol.isPoly(true)).toEqual(true);\r\n            expect(nerdamer('7*y*x^2+z*x^-1+4').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('sqrt(5*x)+7').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('abs(5*x^3)-x+7').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('cos(x)^2+cos(x)+1').symbol.isPoly(true)).toEqual(false);\r\n            expect(nerdamer('sqrt(97)x^2-sqrt(13)x+sqrt(14)x+sqrt(43)x^2+sqrt(3)*sqrt(101)').symbol.isPoly(true)).toEqual(true);\r\n            expect(nerdamer('-5 sqrt(14)x-14x^2 sqrt(83)').symbol.isPoly(true)).toEqual(true);\r\n        });\r\n\r\n        it('should evaluate abs() directly', function () {\r\n            // given\r\n            var formula = 'abs(5*x^2)-x+11';\r\n\r\n            // when\r\n            var isPoly = nerdamer(formula).symbol.isPoly();\r\n\r\n            // then\r\n            expect(isPoly).toBeTruthy();\r\n        });\r\n    });\r\n\r\n    it('should perform divisions', function () {\r\n        expect(nerdamer('div(x^2*y^3+b*y^2+3*a*x^2*y+3*a*b, y^2+3*a)').toString()).toEqual('[b+x^2*y,0]');\r\n        expect(nerdamer('div(x^2, x^3)').toString()).toEqual('[0,x^2]');\r\n        expect(nerdamer('div(cos(x^2)^2+2*cos(x^2)+1, cos(x^2)+1)').toString()).toEqual('[1+cos(x^2),0]');\r\n        expect(nerdamer('div(2*x^2+2*x+1, x+1)').toString()).toEqual('[2*x,1]');\r\n        expect(nerdamer('div(7*x,2*x)').toString()).toEqual('[7/2,0]');\r\n        expect(nerdamer('div(7*b*z^2+14*y*z+14*a*x^2*z-b*t*z-2*t*y-2*a*t*x^2, 7*z-t)').toString()).toEqual('[2*a*x^2+2*y+b*z,0]');\r\n        expect(nerdamer('div(x^2+5, y-1)').toString()).toEqual('[0,5+x^2]');\r\n        expect(nerdamer('div(4*a*x^2*y^2+4*a*y^2+b*x^2+a*x^2+b+a, x^2+1)').toString()).toEqual('[4*a*y^2+a+b,0]');\r\n        expect(nerdamer('div(4*a*x^2*y^2+4*a*y^2+b*x^2+a*x^2+b+a+u^6+1, x^2+1)').toString()).toEqual('[4*a*y^2+a+b,1+u^6]');\r\n        expect(nerdamer('div(15*x^9-25*x^7-35*x^6+6*x^5+3*x^4-10*x^3-19*x^2-7*x, 3*x^3-5*x-7)').toString()).toEqual('[2*x^2+5*x^6+x,0]');\r\n        expect(nerdamer('div(sin(x)^2*tan(x)-4*cos(x)*tan(x)+cos(x)*sin(x)^2-4*cos(x)^2, sin(x)^2-4*cos(x)^2)').toString()).toEqual('[cos(x)+tan(x),-4*cos(x)*tan(x)-4*cos(x)^2+4*cos(x)^3+4*cos(x)^2*tan(x)]');\r\n        expect(nerdamer('div(y^2*z-4*x*z+x*y^2-4*x^2, y^2-4*x^2)').toString()).toEqual('[x+z,-4*x*z-4*x^2+4*x^3+4*x^2*z]');\r\n        expect(nerdamer('div(-5*y^2+16*a*y+5*x^4+14*a*x^2-3*a^2, 3*a-y+x^2)').toString()).toEqual('[-a+5*x^2+5*y,0]');\r\n        expect(nerdamer('div(y^2+2*x*y+x^2,x+y)').toString()).toEqual('[x+y,0]');\r\n        expect(nerdamer('div(x*y^2+x^2*y-y-x, x*y-1)').toString()).toEqual('[x+y,0]');\r\n        expect(nerdamer('div(y^2*z-4*x*z+x*y^2-4*x^2+x^2, y^2-4*x^2)').toString()).toEqual('[x+z,-3*x^2+4*x^3-4*x*z+4*x^2*z]');\r\n        expect(nerdamer('div(7*x^6*z-a*x*z+28*a*x^6*y^3-4*a^2*x*y^3+7*b*x^6-a*b*x, 4*y^3*a+z+b)').toString()).toEqual('[-a*x+7*x^6,0]');\r\n        expect(nerdamer('div(x^2+5, cos(x)-1)').toString()).toEqual('[0,5+x^2]');\r\n        expect(nerdamer('div((1+z), t*x+7)').toString()).toEqual('[0,1+z]');\r\n        expect(nerdamer('div(-x^2*y-y+4*a*x^2+t+4*a+6*b, x^2+1)').toString()).toEqual('[-y+4*a,6*b+t]');\r\n        expect(nerdamer('div(15*x^9-25*x^7-35*x^6+6*x^5+3*x^4-10*x^3-19*x^2-7*x+y, 3*x^3-5*x-7)').toString()).toEqual('[2*x^2+5*x^6+x,y]');\r\n        expect(nerdamer('div(x^2+2*x+1+u, x+1)').toString()).toEqual('[1+x,u]');\r\n        expect(nerdamer('div(y^3+x*y^2+x^2*y+x^3+x, x+y)').toString()).toEqual('[x^2+y^2,x]');\r\n        expect(nerdamer('div(b*y*z+7*x^6*z-a*x*z-7*z+4*a*b*y^4+28*a*x^6*y^3-4*a^2*x*y^3-28*a*y^3+b^2*y+7*b*x^6-a*b*x-7*b, 4*y^3*a+z+b)').toString()).toEqual('[-7-a*x+7*x^6+b*y,0]');\r\n        expect(nerdamer('div(b*y*z-a*x*z+4*a*b*y^4-4*a^2*x*y^3+b^2*y-a*b*x, 4*y^3*a+z+b)').toString()).toEqual('[-a*x+b*y,0]');\r\n        expect(nerdamer('div(17*x^3*y+3*x^2*y+34*x+6, x^2*y+2)').toString()).toEqual('[17*x+3,0]');\r\n        expect(nerdamer('div(b^2*y^2+2*a*b*y^2+a^2*y^2+2*b^2*x*y+4*a*b*x*y+2*a^2*x*y+b^2*x^2+2*a*b*x^2+a^2*x^2, 2*b*y^2+2*a*y^2+4*b*x*y+4*a*x*y+2*b*x^2+2*a*x^2)').toString()).toEqual('[(1/2)*a+(1/2)*b,0]');\r\n        expect(nerdamer('div(2*a*b*x+2*a*b*y+a^2*x+a^2*y+b^2*x+b^2*y, x+y)').toString()).toEqual('[2*a*b+a^2+b^2,0]');\r\n        expect(nerdamer('div((2x-1)(3x^2+5x-2)-7x-14,x^2+1)').toString()).toEqual('[6*x+7,-19-22*x]');\r\n        expect(nerdamer('div(2(x+1)^5+1,x+2)').toString()).toEqual('[2+2*x^4+4*x+6*x^3+8*x^2,-1]');\r\n        expect(nerdamer('divide(a*b^(-1)+b^(-1)*c,a+c)').toString()).toEqual('b^(-1)');\r\n        expect(nerdamer('divide(-20+16*i,-10+8*i)').toString()).toEqual('2');\r\n    });\r\n    /** #3: \"(a-b)^2 - (b-a)^2\" not simplifying. */\r\n    it('should simplify to 0', function () {\r\n      // given\r\n      var formula = '(a-b)^2-(b-a)^2';\r\n\r\n      // when\r\n      var result = nerdamer(formula, null, ['numer', 'expand']).toString();\r\n\r\n      // then\r\n      expect(result).toBe('0');\r\n    });\r\n    /** #40: Expected more simple solution for factoring. */\r\n    it('should use simple factor result', function () {\r\n      // given\r\n      var formula = 'factor(x^2+x+1/4)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      expect(result).toBe('(1/4)*(1+2*x)^2');\r\n    });\r\n\r\n    /** #43: Formula not expanded. */\r\n    it('should expand formula', function () {\r\n      // given\r\n      var formula = 'expand((x+5)(x-3)-x^2)';\r\n\r\n      // when\r\n      var result = nerdamer(formula).toString();\r\n\r\n      // then\r\n      expect(result).toBe('-15+2*x');\r\n    });\r\n    it('should factor correctly', function () {\r\n        expect(nerdamer('factor(x^2+2*x+1)').toString()).toEqual('(1+x)^2');\r\n        expect(nerdamer('factor(x^2-y^2)').toString()).toEqual('(-y+x)*(x+y)');\r\n        expect(nerdamer('factor(a^2*x^2-b^2*y^2)').toString()).toEqual('(-b*y+a*x)*(a*x+b*y)');\r\n        // expect(nerdamer('factor(x^2-6*x+9-4*y^2)').toString()).toEqual('(-2*y-3+x)*(-3+2*y+x)');\r\n        expect(nerdamer('factor(b^6+3*a^2*b^4+3*a^4*b^2+a^6)').toString()).toEqual('(a^2+b^2)^3');\r\n        expect(nerdamer('factor(b^6+12*a^2*b^4+48*a^4*b^2+64*a^6)').toString()).toEqual('((9007199254740996/2251799813685249)*a^2+b^2)^3');\r\n        expect(nerdamer('factor(c^6+3*b^2*c^4+3*a^2*c^4+3*b^4*c^2+6*a^2*b^2*c^2+3*a^4*c^2+b^6+3*a^2*b^4+3*a^4*b^2+a^6)').toString()).toEqual('(a^2+b^2+c^2)^3');\r\n        expect(nerdamer('factor(x^4+25*x^3+234*x^2+972*x+1512)').toString()).toEqual('(6+x)^3*(7+x)');\r\n        expect(nerdamer('factor(x^5+32*x^4+288*x^3-418*x^2-16577*x-55902)').toString()).toEqual('(-7+x)*(11+x)^3*(6+x)');\r\n        expect(nerdamer('factor(x^2*y*z+x*z+t*x^2*y+t*x)').toString()).toEqual('(1+x*y)*(t+z)*x');\r\n        expect(nerdamer('factor(x^2*y+x^2)').toString()).toEqual('(1+y)*x^2');\r\n        expect(nerdamer('factor(sqrt(4*x^2*y+4*x^2))').toString()).toEqual('2*abs(x)*sqrt(1+y)');\r\n        expect(nerdamer('factor(x^3-1/2x^2-13/2x-3)').toString()).toEqual('(1/2)*(-3+x)*(1+2*x)*(2+x)');\r\n        expect(nerdamer('factor(x^16-1)').toString()).toEqual('(-1+x)*(1+x)*(1+x^2)*(1+x^4)*(1+x^8)');\r\n        expect(nerdamer('factor(-1866240-311040*x^2-3265920*x+1120*x^8+150080*x^6+17610*x^7+2026080*x^4+2509920*x^3+30*x^9+738360*x^5)').toString()).toEqual('10*(-1+x)*(1+x)*(3*x+4)*(6+x)^6');\r\n        expect(nerdamer('factor((7x^3+4x^2+x)/(12x^3+6x^2-2x))').toString()).toEqual('(1/2)*(-1+3*x+6*x^2)^(-1)*(1+4*x+7*x^2)');\r\n        expect(nerdamer('factor((-2x-2x^2-2))').toString()).toEqual('-2*(1+x+x^2)');\r\n        expect(nerdamer('factor(1331*x^3*y^3+216*z^6)').toString()).toEqual('(-66*x*y*z^2+121*x^2*y^2+36*z^4)*(11*x*y+6*z^2)');\r\n        expect(nerdamer('factor(1331*x^3*y^3-216*z^6)').toString()).toEqual('(-6*z^2+11*x*y)*(121*x^2*y^2+36*z^4+66*x*y*z^2)');\r\n        expect(nerdamer('factor(64a^3-27b^3)').toString()).toEqual('(-3*b+4*a)*(12*a*b+16*a^2+9*b^2)');\r\n        expect(nerdamer('factor(64*x^3+125)').toString()).toEqual('(-20*x+16*x^2+25)*(4*x+5)');\r\n        expect(nerdamer('factor((-5*K+32)^2)').toString()).toEqual('(-32+5*K)^2');\r\n        expect(nerdamer('factor(100)').toString()).toEqual('2^2*5^2');\r\n        expect(nerdamer('factor(100*x)').toString()).toEqual('100*x');\r\n        expect(nerdamer('(2*y+p)^2').toString()).toEqual('(2*y+p)^2');\r\n    });\r\n    it('should not have any regression to factor', function() {\r\n        //this test will absolutely break as factor improves enough to factor this expression. For now it just serves as a safeguard\r\n        expect(nerdamer('factor(x^a+2x^(a-1)+1x^(a-2))').toString()).toEqual('2*x^(-1+a)+x^(-2+a)+x^a');\r\n    });\r\n    it('should correctly determine the polynomial degree', function () {\r\n        expect(nerdamer('deg(x^2+2*x+x^5)').toString()).toEqual('5');\r\n        expect(nerdamer('deg(x^2+2*x+x^x)').toString()).toEqual('max(2,x)');\r\n        expect(nerdamer('deg(x^2+2*x+cos(x))').toString()).toEqual('2');\r\n        expect(nerdamer('deg(x^a+x^b+x^c,x)').toString()).toEqual('max(a,b,c)');\r\n        expect(nerdamer('deg(a*x^2+b*x+c,x)').toString()).toEqual('2');\r\n    });\r\n    it('should correctly peform partial fraction decomposition', function () {\r\n        expect(nerdamer('partfrac((3*x+2)/(x^2+x), x)').toString()).toEqual('(1+x)^(-1)+2*x^(-1)');\r\n        expect(nerdamer('partfrac((17*x-53)/(x^2-2*x-15), x)').toString()).toEqual('13*(3+x)^(-1)+4*(-5+x)^(-1)');\r\n        expect(nerdamer('partfrac((x^3+2)/(x+1)^2,x)').toString()).toEqual('(1+x)^(-2)+3*(1+x)^(-1)-2+x');\r\n        expect(nerdamer('partfrac(x/(x-1)^2, x)').toString()).toEqual('(-1+x)^(-1)+(-1+x)^(-2)');\r\n        expect(nerdamer('partfrac((x^2+1)/(x*(x-1)^3), x)').toString()).toEqual('(-1+x)^(-1)+2*(-1+x)^(-3)-x^(-1)');\r\n        expect(nerdamer('partfrac((17-53)/(x^2-2*x-15), x)').toString()).toEqual('(-9/2)*(-5+x)^(-1)+(9/2)*(3+x)^(-1)');\r\n        expect(nerdamer('partfrac(1/(x^6-1),x)').toString()).toEqual('(-1/3)*(-x+x^2+1)^(-1)+(-1/3)*(1+x+x^2)^(-1)+(-1/6)*(1+x)^(-1)+(-1/6)*(1+x+x^2)^(-1)*x+(1/6)*(-1+x)^(-1)+(1/6)*(-x+x^2+1)^(-1)*x');\r\n        expect(nerdamer('partfrac((3*x^2-3*x-8)/((x-5)*(x^2+x-4)),x)').toString()).toEqual('(-4+x+x^2)^(-1)*x+2*(-5+x)^(-1)');\r\n        expect(nerdamer('partfrac(15*(9+s^2)^(-1)*cos(1)+5*(9+s^2)^(-1)*s*sin(1),s)').toString()).toEqual('(15*cos(1)+5*s*sin(1))*(9+s^2)^(-1)');\r\n    });\r\n    it('should prime factor correctly', function () {\r\n        expect(nerdamer('pfactor(100!)').toString()).toEqual('(11^9)*(13^7)*(17^5)*(19^5)*(23^4)*(29^3)*(2^97)*(31^3)*(37^2)*(3^48)*(41^2)*(43^2)*(47^2)*(53)*(59)*(5^24)*(61)*(67)*(71)*(73)*(79)*(7^16)*(83)*(89)*(97)');\r\n        expect(nerdamer('pfactor(100)').toString()).toEqual('(2^2)*(5^2)');\r\n        expect(nerdamer('pfactor(8)').toString()).toEqual('(2^3)');\r\n        expect(nerdamer('pfactor(999999999999)').toString()).toEqual('(101)*(11)*(13)*(37)*(3^3)*(7)*(9901)');\r\n        expect(nerdamer('pfactor(1000000005721)').toString()).toEqual('(1000000005721)');\r\n        expect(nerdamer('pfactor(1000000005721092)').toString()).toEqual('(131)*(212044106387)*(2^2)*(3^2)');\r\n        expect(nerdamer('pfactor(-10000000114421840327308)').toString()).toEqual('(-2^2)*(480827)*(7)*(8345706745687)*(89)');\r\n        expect(nerdamer('pfactor(-7877474663)').toString()).toEqual('(-97)*(180871)*(449)');\r\n        expect(nerdamer('pfactor(15!+1)').toString()).toEqual('(46271341)*(479)*(59)');\r\n        expect(nerdamer('pfactor(15!+11!)').toString()).toEqual('(11)*(181^2)*(2^8)*(3^4)*(5^2)*(7)');\r\n        expect(nerdamer('pfactor(product(n!,n,1,10))').toString()).toEqual('(2^38)*(3^17)*(5^7)*(7^4)');\r\n        expect(nerdamer('pfactor(4677271)').toString()).toEqual('(2089)*(2239)');\r\n    });\r\n    it('should get coeffs', function () {\r\n        expect(nerdamer('coeffs(x^2+2*x+1, x)').toString()).toEqual('[1,2,1]');\r\n        expect(nerdamer('coeffs(a*b*x^2+c*x+d, x)').toString()).toEqual('[d,c,a*b]');\r\n        expect(nerdamer('coeffs(t*x, x)').toString()).toEqual('[0,t]');\r\n        expect(nerdamer('coeffs(b*(t*x-5), x)').toString()).toEqual('[-5*b,b*t]');\r\n        expect(nerdamer('coeffs(a*x^2+b*x+c+x, x)').toString()).toEqual('[c,1+b,a]');\r\n    });\r\n    it('should get all coeffs', function () {\r\n        expect(nerdamer('coeffs(x+A+1,x)').toString()).toEqual('[1+A,1]');\r\n        expect(nerdamer.coeffs('2x+i*x+5', 'x').toString()).toEqual('[5,2+i]');\r\n    });\r\n    it('should calculate the line function', function () {\r\n        expect(nerdamer('line([1,2], [3,4])').toString()).toEqual('1+x');\r\n        expect(nerdamer('line([a1,b1], [a2,b2], t)').toString()).toEqual('(-a1+a2)^(-1)*(-b1+b2)*t-(-a1+a2)^(-1)*(-b1+b2)*a1+b1');\r\n    });\r\n    it('sho veredBy":[],"location":{"end":{"column":29,"line":132},"start":{"column":8,"line":132}}},{"id":"882","mutatorName":"StringLiteral","replacement":"\"\"","status":"Timeout","static":true,"coveredBy":[],"location":{"end":{"column":29,"line":133},"start":{"column":8,"line":133}}}],"source":"/* global expect */\n\n'use strict';\n\nvar utils = require('./support/utils');\nvar parse = utils.parse;\nvar _$ = utils.toFixed;\n\ndescribe('Basic operations', function() {\n    it('should add correctly', function(){expect(parse('1+1')).toEqual(2);});\n    it('should subtract correctly', function(){expect(parse('3-1')).toEqual(2);});\n    it('should divide correctly', function(){expect(parse('6/3')).toEqual(2);});\n    it('should multiply correctly', function(){expect(parse('2*6')).toEqual(12);});\n    it('should raise to power correctly', function(){expect(parse('2^3')).toEqual(8);});\n    it('should parse scientific notation correctly', function(){expect(parse('1.234e+1')).toEqual(12.34);});\n    it('should parse non-normalized scientific notation correctly', function(){expect(parse('12.3e-1')).toEqual(1.23);});\n});\n\ndescribe('Order of precedence', function() {\n    it('should recognize * > +', function(){expect(parse('3*5+3')).toEqual(18);});\n    it('should recognize + = -', function(){expect(parse('4+5-11')).toEqual(-2);});\n    it('should recognize ^ = +', function(){expect(parse('2^3-3')).toEqual(5);});\n    it('should recognize ^ > *', function(){expect(parse('2^3*3')).toEqual(24);});\n    it('should recognize / = *', function(){expect(parse('6/3*5')).toEqual(10);});\n    it('should recognize / = +', function(){expect(_$(parse('2/3+2/3'))).toEqual(_$(1.3333333333333333));});\n    it('should recognize ^ is right associative', function(){expect(parse('2^3^2')).toEqual(512);});\n});\n\ndescribe('Percentages', function() {\n    it('should calculate percentages', function(){expect(parse('5%')).toEqual(0.05);});\n    it('should add percentages', function(){expect(parse('5%+5%')).toEqual(0.1);});\n    it('should multiply percentages', function(){expect(parseFloat(parse('10%*10%').toFixed(2))).toEqual(0.01);});\n    it('should multiply percentages by numbers', function(){expect(parse('100*10%')).toEqual(10);});\n});\n\ndescribe('Functions', function() {\n    it('should calculate functions', function(){expect(_$(parse('sin(1)'))).toEqual(_$(0.8414709848078965));});\n    it('should calculate functions', function(){expect(_$(parse('sin(sin(2))'))).toEqual(_$(0.7890723435728884));});\n    it('should add with functions', function(){expect(_$(parse('sin(sin(2))+4'))).toEqual(_$(4.789072343572888));});\n    it('should handle function with arguments', function(){expect(parse('max(4,6,3)')).toEqual(6);});\n    it('should handle function with arguments with operations', function(){expect(parse('max(4,5+7,3)')).toEqual(12);});\n    it('should handle function with arguments with operations and subsequent operations', \n        function(){expect(parse('max(4,5+7,3)+11')).toEqual(23);}\n    );\n});\n\ndescribe('Modulus', function() {\n    it('should calculate modulus', function(){expect(parse('10%4')).toEqual(2);});\n    it('should add with modulus', function(){expect(parse('10%4+6')).toEqual(8);});\n    it('should multiply with modulus', function(){expect(parse('10%4*8')).toEqual(16);});\n    it('should add and multiply with modulus', function(){expect(parse('2+10%4*8')).toEqual(18);});\n    it('should respect modulus in functions', function(){expect(parse('max(3,2+10%4*8,5)')).toEqual(18);});\n    it('should respect modulus with percentages', function(){expect(parse('8000%%8')).toEqual(0);});\n    it('should correctly handle modulus left assoc', function(){expect(parse('3*3%9')).toEqual(0);});\n});\n\ndescribe('Brackets', function() {\n    it('should respect parentheses', function(){expect(parse('4*(2+1)')).toEqual(12);});\n    it('should respect parentheses within parentheses', function(){expect(parse('3*(4+(2+1))')).toEqual(21);});\n    it('should recognize vectors', function(){expect(parse('[1,2,[3,4]]').toString()).toEqual('[1,2,[3,4]]');});\n    it('should handle multiple levels of brackets', function() {expect(parse('((((((((9))))))))+1')).toEqual(10);});\n    it('should handle multiple levels of brackets', function() {expect(parse('((((((1+1))+4)))+3)')).toEqual(9);});\n});\n\ndescribe('Prefixes', function() {\n    it('should correctly parse prefixes', function(){\n        expect(parse('-(-3*-(4))')).toEqual(-12);\n        expect(_$(parse('3^-1^-1'))).toEqual(_$(0.333333333333333));\n        expect(parse('-(-1-+1)^2')).toEqual(-4);\n        expect(parse('-(-1-1+1)')).toEqual(1);\n        expect(parse('-(1)--(1-1--1)')).toEqual(0);\n        expect(parse('-(-(1))-(--1)')).toEqual(0);\n        expect(_$(parse('5^-2^-4'))).toEqual(_$(0.9043038394024115));\n        expect(parse('5^---3')).toEqual(0.008);\n        expect(parse('5^-(++1+--+2)')).toEqual(0.008);\n        expect(parse('(5^-(++1+--+2))^-2')).toEqual(15625);\n        expect(parse('(5^-3^2)')).toEqual(5.12e-7);\n        expect(parse('-(--5*--7)')).toEqual(-35);\n    });\n});\n\n/*\n//Future TODO. The skeleton is there but currently too many specs fail\ndescribe('Spaces', function() {\n    it('should respect spaces when parsing', function(){\n        expect(parse('sin 9')).toEqual(0.4121184852417566);\n    });\n    it('should ingore other spaces when parsing', function(){\n        expect(parse('sin 9 + 11')).toEqual(11.4121184852417566);\n        expect(parse('sin 9+ 11')).toEqual(11.4121184852417566);\n        expect(parse('sin 9+11')).toEqual(11.4121184852417566);\n        expect(parse('2* sin 9+11')).toEqual(11.824236970483513);\n        expect(parse('2 * sin 9+11')).toEqual(11.824236970483513);\n        expect(parse(' 2 * sin 9+11 ')).toEqual(11.824236970483513);\n    });\n    it('should correctly identify spaces with arguments', function(){\n        expect(parse(' max( 5 , 2 , 17 ) ')).toEqual(17);\n    });\n    it('should correctly identify matrices with spaces', function(){\n        expect(parse('[ 1, [ 3, 5, 7 ] , [1 , [2, [ 1, 2] ]] ]').toString()).toEqual('[1,[3,5,7],[1,[2,[1,2]]]]');\n    });\n});\n*/\n\ndescribe('Accessing vectors', function(){\n    it('should correctly access vectors', function(){\n        expect(parse('[1,[3,5,7],[1,[2,[1,2]]]][2]').toString()).toEqual('[1,[2,[1,2]]]');\n        expect(parse('[1,[3,5,7],[1,[2,[1,2]]]][2][1]').toString()).toEqual('[2,[1,2]]');\n        expect(parse('[1,[3,5,7],[1,[2,[1,2]]]][2][1][1]').toString()).toEqual('[1,2]');\n        expect(parse('[1,[3,5,7],[1,[2,[1,2]]]][2][1][1][0]').toString()).toEqual('1');\n        expect(parse('5*[1,[3,5,7],[1,[2,[1,2]]]][2][1][1][0]').toString()).toEqual('5');\n        expect(parse('5*[1,[3,5,7],[1,[2,[1,2]]]][2][1][1][0]+8').toString()).toEqual('13');\n    });\n    it('should access ranges', function(){\n        expect(parse('[1,2,3,4,5][1:4]').toString()).toEqual('[2,3,4]');\n    });\n    it('should access using negative indices', function(){\n        expect(parse('[1,2,3,4,5][-2]').toString()).toEqual('4');\n    });\n    it('should not confuse vector wit accessor', function(){\n        expect(parse('[[1,2],[3,4],[5,6]]').toString()).toEqual('[[1,2],[3,4],[5,6]]');\n    });\n});\n\ndescribe('Setting vector values', function() {\n   it('should set values of vectors with the assign operator', function() {\n       expect(parse('[1,2][1]:x').toString()).toEqual('[1,x]');\n   });\n});\n\ndescribe('Substitutions', function(){\n    it('should substitute x', function() {expect(parse('x+1', {x: 4})).toEqual(5);});\n    it('should substitute x', function() {expect(parse('2*x+1', {x: 4})).toEqual(9);});\n});\n"},"spec/build.spec.js":{"language":"javascript","mutants":[{"id":"895","mutatorName":"StringLiteral","replacement":"\"\"","statusReason":"ReferenceError: x is not defined","status":"Killed","static":false,"testsCompleted":1,"killedBy":["65"],"coveredBy":["65"],"location":{"end":{"column":29,"line":18},"start":{"column": ng()).toEqual('4*(sec(x)*tan(x)^2+sec(x)^3)');\r\n        expect(nerdamer('diff(sqrt(7),x)').toString()).toEqual('0');\r\n        expect(nerdamer('diff(4,x)').toString()).toEqual('0');\r\n        expect(nerdamer('diff(x^2,x)').toString()).toEqual('2*x');\r\n        expect(nerdamer('diff(2*x^2+4,x)').toString()).toEqual('4*x');\r\n        expect(nerdamer('diff(sqrt(x)*x,x)').toString()).toEqual('(3/2)*x^(1/2)');\r\n        expect(nerdamer('diff(sqrt(x)-1/sqrt(x),x)').toString()).toEqual('(1/2)*x^(-1/2)+(1/2)*x^(-3/2)');\r\n        expect(nerdamer('diff(x^2/3-3/x^2,x)').toString()).toEqual('(2/3)*x+6*x^(-3)');\r\n        expect(nerdamer('diff(sqrt(x)*(x^2+1),x)').toString()).toEqual('(1/2)*(1+x^2)*x^(-1/2)+2*x^(3/2)');\r\n        expect(nerdamer('diff(e^x/(e^x-1),x)').toString()).toEqual('(-1+e^x)^(-1)*e^x-(-1+e^x)^(-2)*e^(2*x)');\r\n        expect(nerdamer('diff(e^x,x)').toString()).toEqual('e^x');\r\n        expect(nerdamer('diff(e^x/x,x)').toString()).toEqual('-e^x*x^(-2)+e^x*x^(-1)');\r\n        expect(nerdamer('diff(tan(x)*log(1/cos(x)),x)').toString()).toEqual('-(-cos(x)^(-1)*sin(x)*tan(x)+log(cos(x))*sec(x)^2)');\r\n        expect(nerdamer('diff((2*x)^(e),x)').toString()).toEqual('2^e*e*x^(-1+e)');\r\n        expect(nerdamer('diff(2*cos(x)*log(x),x)').toString()).toEqual('2*(-log(x)*sin(x)+cos(x)*x^(-1))');\r\n        expect(nerdamer('diff(cos(5*x)*log(sec(sqrt(cos(x^(4/5))^2))/y^2)*y,x)').toString()).toEqual('(-4/5)*abs(cos(x^(4/5)))^(-1)*cos(x^(4/5))*sec(abs(cos(x^(4/5))))*sin(x^(4/5))*tan(abs(cos(x^(4/5))))*x^(-1/5)*y^(-2)*cos(5*x)*sec(abs(cos(x^(4/5))))^(-1)*y^3-5*log(sec(abs(cos(x^(4/5))))*y^(-2))*sin(5*x)*y');\r\n        expect(nerdamer('diff(x*cos(x)^log(x),x)').toString()).toEqual('(-cos(x)^(-1)*log(x)*sin(x)+log(cos(x))*x^(-1))*cos(x)^log(x)*x+cos(x)^log(x)');\r\n        expect(nerdamer('diff(cos(2*x),x)').toString()).toEqual('-2*sin(2*x)');\r\n        expect(nerdamer('diff(cos(x)*tan(x),x)').toString()).toEqual('-sin(x)*tan(x)+cos(x)*sec(x)^2');\r\n        expect(nerdamer('diff(sec(sqrt(cos(x^(4/5))^2)),x)').toString()).toEqual('(-4/5)*abs(cos(x^(4/5)))^(-1)*cos(x^(4/5))*sec(abs(cos(x^(4/5))))*sin(x^(4/5))*tan(abs(cos(x^(4/5))))*x^(-1/5)');\r\n        expect(nerdamer('diff(log(log(log(cos(t*t)^z))),t)').toString()).toEqual('-2*cos(t^2)^(-1)*sin(t^2)*t*z*log(cos(t^2))^(-1)*log(log(cos(t^2))*z)^(-1)*z^(-1)');\r\n        expect(nerdamer('diff(6*log(x)^(3*log(x^2)),x)').toString()).toEqual('36*(log(log(x))*x^(-1)+x^(-1))*log(x)^(6*log(x))');\r\n        expect(nerdamer('diff(sinh(x^2)^cos(x),x)').toString()).toEqual('(-log(sinh(x^2))*sin(x)+2*cos(x)*cosh(x^2)*sinh(x^2)^(-1)*x)*sinh(x^2)^cos(x)');\r\n        expect(nerdamer('diff(tan(x)*tanh(x),x)').toString()).toEqual('sec(x)^2*tanh(x)+sech(x)^2*tan(x)');\r\n        expect(nerdamer('diff(4*x*tan(x)*7*tanh(x),x)').toString()).toEqual('28*(sec(x)^2*tanh(x)*x+sech(x)^2*tan(x)*x+tan(x)*tanh(x))');\r\n        expect(nerdamer('diff(y*tan(y)*7*tanh(y),x)').toString()).toEqual('0');\r\n        expect(nerdamer('diff(yx*tan(y)*7*tanh(y),x)').toString()).toEqual('0');\r\n        expect(nerdamer('diff(y,x)').toString()).toEqual('0');\r\n        expect(nerdamer('diff(x*y,x)').toString()).toEqual('y');\r\n        expect(nerdamer('diff([sin(x), x^2, x],x)').toString()).toEqual('[cos(x),2*x,1]');\r\n        expect(nerdamer('diff(sinc(a*x^3+b),x)').toString()).toEqual('3*((a*x^3+b)*cos(a*x^3+b)-sin(a*x^3+b))*(a*x^3+b)^(-2)*a*x^2');\r\n        expect(nerdamer('diff(sqrt(e^x + a),x)').toString()).toEqual('(1/2)*(a+e^x)^(-1/2)*e^x');\r\n    });\r\n\r\n    it('should calculate sums correctly', function () {\r\n        expect(nerdamer('sum(x+y, x, 0, 3)').evaluate().toString()).toEqual('4*y+6');\r\n        expect(nerdamer('sum(x^2+x, x, 0, 10)').evaluate().toString()).toEqual('440');\r\n        expect(nerdamer('sum(x^2*z^2+x*y-z+1, x, 0, 10)').evaluate().toString()).toEqual('-11*z+385*z^2+11+55*y');\r\n        expect(nerdamer('sum(x^2*z^2+x*y-z+1, z, 0, 10)').evaluate().toString()).toEqual('-44+11*x*y+385*x^2');\r\n        expect(nerdamer('sum(sqrt(x)*sin(x), x, 0, 10)').evaluate().toString()).toEqual('775334583/372372283');\r\n        expect(nerdamer('sum(e^(-x^2*π/9),x,1,100)').evaluate().toString()).toEqual('633863423979/633863423978');\r\n    });\r\n\r\n    it('should calculate the definite integral correctly', function () {\r\n        expect(round(nerdamer('defint(cos(x),1,2,x)').evaluate(), 14)).toEqual(round(0.067826442018, 14));\r\n        expect(round(nerdamer('defint(cos(x)^3*x^2-1,-1,9)').evaluate(), 14)).toEqual(round(8.543016466395, 14));\r\n        expect(round(nerdamer('defint(cos(x^x),1,2,x)').evaluate(), 14)).toEqual(round(-0.27113666621, 14));\r\n        expect(round(nerdamer('defint(cos(x^log(sin(x))),2,3,x)').evaluate(), 14)).toEqual(round(0.805604089074, 14));\r\n        expect(round(nerdamer('defint(log(2*cos(x/2)),-π,π,x)').evaluate(), 14)).toEqual(round(-0, 14));\r\n        expect(round(nerdamer('defint(log(cos(x/2)),-π,π,x)').evaluate(), 14)).toEqual(round(-4.355172180607, 14));\r\n        expect(round(nerdamer('defint(log(x+1), -1, 1, x)').evaluate(), 14)).toEqual(round(-0.6137056388801095, 14));\r\n        expect(round(nerdamer('defint(log(x), 0, 1, x)').evaluate(), 14)).toEqual(round(-1, 14));\r\n        expect(round(nerdamer('defint((x^2-3)/(-x^3+9x+1), 1, 3, x)').evaluate(), 14)).toEqual(round(0.732408192445406585, 14));\r\n        expect(round(nerdamer('defint(x*(x-5)^(1/2),5,8)').evaluate(), 14)).toEqual(round(23.555890982936999348, 14));\r\n        expect(round(nerdamer('defint(sqrt(4(x^2)+4), 0, 3)').evaluate(), 14)).toEqual(round(11.305279439735999908, 14));\r\n    });\r\n\r\n    it('should calculate limits correctly', function () {\r\n        expect(nerdamer('limit((2-2*x^2)/(x-1), x, 1)').toString()).toEqual('-4');\r\n        expect(nerdamer('limit(1/2*(x^2 - 1)/(x^2 + 1), x, 3)').toString()).toEqual('2/5');\r\n        expect(nerdamer('limit(tan(3*x)/tan(x), x, pi/2)').toString()).toEqual('1/3');\r\n        expect(nerdamer('limit(x/(3*abs(4*x)),x, 0)').toString()).toEqual('[-1/12,1/12]');\r\n        expect(nerdamer('limit((4x^2-x)/(3x^2+x),x,∞)').toString()).toEqual('4/3');\r\n        expect(nerdamer('limit((x^(1/2)+x^(-1/2))/(x^(1/2)-x^(-1/2)),x,Infinity)').toString()).toEqual('1');\r\n        expect(nerdamer('limit((2*x+log(x))/(x*log(x)),x,Infinity)').toString()).toEqual('0');\r\n        expect(nerdamer('limit(e^(-x)+2,x,Infinity)').toString()).toEqual('2');\r\n        expect(nerdamer('limit((x+1)^(1+1/x)-x^(1+x),x, Infinity)').toString()).toEqual('-Infinity');\r\n        expect(nerdamer('limit(x/(x+1)^2, x, -1)').toString()).toEqual('-Infinity');\r\n\r\n        // Revisit.\r\n        /*\r\n         expect(nerdamer('limit(cos(sin(x)+2), x, Infinity)').toString()).toEqual('[cos(1),cos(3)]');\r\n         expect(nerdamer('limit((2sin(x)-sin(2x))/(x-sin(x)),x,0)').toString()).toEqual('6');\r\n         expect(nerdamer('limit((3*sin(x)-sin(2*x))/(x-sin(x)),x,0)').toString()).toEqual('Infinity');\r\n         expect(nerdamer('limit(log(x),x, 0)').toString()).toEqual('Infinity');\r\n         */\r\n    });\r\n\r\n    it('should integrate properly', function () {\r\n        expect(nerdamer('integrate(sin(x), x)').toString()).toEqual('-cos(x)');\r\n        expect(nerdamer('integrate((22/7)^x,x)').toString()).toEqual('(log(1/7)+log(22))^(-1)*22^x*7^(-x)');\r\n        expect(nerdamer('integrate(cos(x), x)').toString()).toEqual('sin(x)');\r\n        expect(nerdamer('integrate(2*x^2+x, x)').toString()).toEqual('(1/2)*x^2+(2/3)*x^3');\r\n        expect(nerdamer('integrate(log(x), x)').toString()).toEqual('-x+log(x)*x');\r\n        expect(nerdamer('integrate(sqrt(x), x)').toString()).toEqual('(2/3)*x^(3/2)');\r\n        expect(nerdamer('integrate(asin(a*x), x)').toString()).toEqual('a^(-1)*sqrt(-a^2*x^2+1)+asin(a*x)*x');\r\n        expect(nerdamer('integrate(a/x, x)').toString()).toEqual('a*log(x)');\r\n        expect(nerdamer('integrate(x*e^x, x)').toString()).toEqual('-e^x+e^x*x');\r\n        expect(nerdamer('integrate(x^3*log(x), x)').toString()).toEqual('(-1/16)*x^4+(1/4)*log(x)*x^4');\r\n        expect(nerdamer('integrate(x^2*sin(x), x)').toString()).toEqual('-cos(x)*x^2+2*cos(x)+2*sin(x)*x');\r\n        expect(nerdamer('integrate(sin(x)*log(cos(x)), x)').toString()).toEqual('-cos(x)*log(cos(x))+cos(x)');\r\n        expect(nerdamer('integrate(x*asin(x), x)').toString()).toEqual('(-1/4)*asin(x)+(1/2)*asin(x)*x^2+(1/4)*cos(asin(x))*sin(asin(x))');\r\n        expect(nerdamer('integrate(q/((2-3*x^2)^(1/2)), x)').toString()).toEqual('asin(3*sqrt(6)^(-1)*x)*q*sqrt(3)^(-1)');\r\n        expect(nerdamer('integrate(1/(a^2+x^2), x)').toString()).toEqual('a^(-1)*atan(a^(-1)*x)');\r\n        expect(nerdamer('integrate(11/(a+5*r*x)^2,x)').toString()).toEqual('(-11/5)*(5*r*x+a)^(-1)*r^(-1)');\r\n        expect(nerdamer('integrate(cos(x)*sin(x), x)').toString()).toEqual('(-1/2)*cos(x)^2');\r\n        expect(nerdamer('integrate(x*cos(x)*sin(x), x)').toString()).toEqual('(-1/2)*cos(x)^2*x+(1/4)*cos(x)*sin(x)+(1/4)*x');\r\n        expect(nerdamer('integrate(t/(a*x+b), x)').toString()).toEqual('a^(-1)*log(a*x+b)*t');\r\n        expect(nerdamer('integrate(x*(x+a)^3, x)').toString()).toEqual('(1/2)*a^3*x^2+(1/5)*x^5+(3/4)*a*x^4+a^2*x^3');\r\n        expect(nerdamer('integrate(4*x/(x^2+a^2), x)').toString()).toEqual('2*log(a^2+x^2)');\r\n        expect(nerdamer('integrate(1/(x^2+3*a^2), x)').toString()).toEqual('a^(-1)*atan(a^(-1)*sqrt(3)^(-1)*x)*sqrt(3)^(-1)');\r\n        expect(nerdamer('integrate(8*x^3/(6*x^2+3*a^2), x)').toString()).toEqual('8*((-1/24)*a^2*log(2*x^2+a^2)+(1/12)*x^2)');\r\n        expect(nerdamer('integrate(10*q/(4*x^2+24*x+20), x)').toString()).toEqual('10*((-1/16)*log(5+x)+(1/16)*log(1+x))*q');\r\n        expect(nerdamer('integrate(x/(x+a)^2, x)').toString()).toEqual('(a+x)^(-1)*a+log(a+x)');\r\n        expect(nerdamer('integrate(sqrt(x-a), x)').toString()).toEqual('(2/3)*(-a+x)^(3/2)');\r\n        expect(nerdamer('integrate(x^n*log(x), x)').toString()).toEqual('(1+n)^(-1)*log(x)*x^(1+n)-(1+n)^(-2)*x^(1+n)');\r\n        expect(nerdamer('integrate(3*a*sec(x)^2, x)').toString()).toEqual('3*a*tan(x)');\r\n        expect(nerdamer('integrate(a/(x^2+b*x+a*x+a*b),x)').toString()).toEqual('(((-a^(-1)*b+1)^(-1)*a^(-1)*b+1)*a^(-1)*log(b+x)-(-a^(-1)*b+1)^(-1)*a^(-1)*log(a+x))*a');\r\n        expect(nerdamer('integrate(log(a*x+b),x)').toString()).toEqual('((a*x+b)*log(a*x+b)-a*x-b)*a');\r\n        expect(nerdamer('integrate(x*log(x),x)').toString()).toEqual('(-1/4)*x^2+(1/2)*log(x)*x^2');\r\n        expect(nerdamer('integrate(log(a*x)/x,x)').toString()).toEqual('(1/2)*log(a*x)^2');\r\n        expect(nerdamer('integrate(log(x)^2,x)').toString()).toEqual('-2*log(x)*x+2*x+log(x)^2*x');\r\n        expect(nerdamer('integrate(t*log(x)^3,x)').toString()).toEqual('(-3*log(x)^2*x-6*x+6*log(x)*x+log(x)^3*x)*t');\r\n        expect(nerdamer('integrate(e^x*sin(x),x)').toString()).toEqual('(1/2)*(-cos(x)*e^x+e^x*sin(x))');\r\n        expect(nerdamer('integrate(e^x*sin(x),x)').toString()).toEqual('(1/2)*(-cos(x)*e^x+e^x*sin(x))');\r\n        expect(nerdamer('integrate(e^(2*x)*sin(x),x)').toString()).toEqual('(4/5)*((-1/4)*cos(x)*e^(2*x)+(1/2)*e^(2*x)*sin(x))');\r\n        expect(nerdamer('integrate(e^(2*x)*sin(x)*x,x)').toString()).toEqual('(-3/25)*e^(2*x)*sin(x)+(4/25)*cos(x)*e^(2*x)+(4/5)*((-1/4)*cos(x)*e^(2*x)+(1/2)*e^(2*x)*sin(x))*x');\r\n        expect(nerdamer('integrate(x*log(x)^2,x)').toString()).toEqual('(-1/2)*log(x)*x^2+(1/2)*log(x)^2*x^2+(1/4)*x^2');\r\n        expect(nerdamer('integrate(x^2*log(x)^2,x)').toString()).toEqual('(-2/9)*log(x)*x^3+(1/3)*log(x)^2*x^3+(2/27)*x^3');\r\n        expect(nerdamer('integrate(x^2*e^(a*x),x)').toString()).toEqual('-2*(-a^(-2)*e^(a*x)+a^(-1)*e^(a*x)*x)*a^(-1)+a^(-1)*e^(a*x)*x^2');\r\n        expect(nerdamer('integrate(8*e^(a*x^2),x)').toString()).toEqual('4*erf(sqrt(-a)*x)*sqrt(-a)^(-1)*sqrt(pi)');\r\n        expect(nerdamer('integrate(5*x*e^(-8*a*x^2),x)').toString()).toEqual('(-5/16)*a^(-1)*e^(-8*a*x^2)');\r\n        expect(nerdamer('integrate(x^2*sin(x),x)').toString()).toEqual('-cos(x)*x^2+2*cos(x)+2*sin(x)*x');\r\n        expect(nerdamer('integrate(8*tan(b*x)^2,x)').toString()).toEqual('8*(-x+b^(-1)*tan(b*x))');\r\n        expect(nerdamer('integrate(sec(a*x)^3,x)').toString()).toEqual('(1/2)*a^(-1)*log(sec(a*x)+tan(a*x))+(1/2)*a^(-1)*sec(a*x)*tan(a*x)');\r\n        expect(nerdamer('integrate(sec(a*x)*tan(a*x),x)').toString()).toEqual('a^(-1)*sec(a*x)');\r\n        expect(nerdamer('integrate(3*a*cot(a*x)^4, x)').toString()).toEqual('3*((-1/3)*a^(-1)*cot(a*x)^3+a^(-1)*cot(a*x)+x)*a');\r\n        expect(nerdamer('integrate(3*a*csc(a*x)^4, x)').toString()).toEqual('3*((-1/3)*a^(-1)*cot(a*x)*csc(a*x)^2+(-2/3)*a^(-1)*cot(a*x))*a');\r\n        expect(nerdamer('integrate(1/8*a*2/(x^3+13*x^2+47*x+35),x)').toString()).toEqual('(1/4)*((-1/8)*log(5+x)+(1/12)*log(7+x)+(1/24)*log(1+x))*a');\r\n        expect(nerdamer('integrate(a*2/(x^2+x),x)').toString()).toEqual('2*(-log(1+x)+log(x))*a');\r\n        expect(nerdamer('integrate((x+7)/(x+1)^3,x)').toString()).toEqual('(-1/2)*(1+x)^(-1)+(-7/2)*(1+x)^(-2)+(-1/2)*(1+x)^(-2)*x');\r\n        expect(nerdamer('integrate((3*x+2)/(x^2+x),x)').toString()).toEqual('2*log(x)+log(1+x)');\r\n        expect(nerdamer('integrate([sin(x), x^2, x],x)').toString()).toEqual('[-cos(x),(1/3)*x^3,(1/2)*x^2]');\r\n        expect(nerdamer('integrate(sinh(x),x)').toString()).toEqual('cosh(x)');\r\n        expect(nerdamer('integrate(cosh(x),x)').toString()).toEqual('sinh(x)');\r\n        expect(nerdamer('integrate(tanh(x),x)').toString()).toEqual('log(cosh(x))');\r\n        expect(nerdamer('integrate(sinh(x)*x,x)').toString()).toEqual('-sinh(x)+cosh(x)*x');\r\n        expect(nerdamer('integrate((x^6+x^2-7)/(x^2+11), x)').toString()).toEqual('(-11/3)*x^3+(1/5)*x^5+122*x-1349*atan(sqrt(11)^(-1)*x)*sqrt(11)^(-1)');\r\n        expect(nerdamer('integrate(x^6/(x^2+11), x)').toString()).toEqual('(-11/3)*x^3+(1/5)*x^5+121*x-1331*atan(sqrt(1 toEqual('(-a^2+s^2)^(-1)*a');\r\n        expect(nerdamer('laplace(a*t^2, t, s)').toString()).toEqual('2*a*s^(-3)');\r\n        expect(nerdamer('laplace(2*sqrt(t), t, s)').toString()).toEqual('s^(-3/2)*sqrt(pi)');\r\n        expect(nerdamer('laplace(x*e^(a*t), t, s)').toString()).toEqual('(-a+s)^(-1)*x');\r\n        expect(nerdamer('laplace(x*(sin(a*t)-a*t*cos(a*t)), t, s)').toString()).toEqual('((a^2+s^2)^(-1)*a-((1+a^2*s^(-2))^(-2)*s^(-2)-(1+a^2*s^(-2))^(-2)*a^2*s^(-4))*a)*x');\r\n        expect(nerdamer('laplace(sin(a*t), t, s)').toString()).toEqual('(a^2+s^2)^(-1)*a');\r\n        expect(nerdamer('laplace(t*sin(a*t), t, s)').toString()).toEqual('2*(1+a^2*s^(-2))^(-2)*a*s^(-3)');\r\n        expect(nerdamer('laplace(sin(a*t+b), t, s)').toString()).toEqual('(1+a^2*s^(-2))^(-1)*a*cos(b)*s^(-2)+(1+a^2*s^(-2))^(-1)*s^(-1)*sin(b)');\r\n        expect(nerdamer('laplace(t^2*e^(a*t), t, s)').toString()).toEqual('-2*(-s+a)^(-3)');\r\n        expect(nerdamer('laplace(6*t*e^(-9*t)*sin(6*t), t, s)').toString()).toEqual('-72*(-9-s)^(-3)*(1+36*(-9-s)^(-2))^(-2)');\r\n        expect(nerdamer('laplace(sinh(t)*e^t, t, s)').toString()).toEqual('(-1/2)*(-s+2)^(-1)+(-1/2)*s^(-1)');\r\n    });\r\n\r\n    it('should invert a Laplace transform correctly', function () {\r\n        expect(nerdamer('ilt(a/(b*x), x, t)').toString()).toEqual('a*b^(-1)');\r\n        expect(nerdamer('ilt(a*6/(b*s^6),s,t)').toString()).toEqual('(1/20)*a*b^(-1)*t^5');\r\n        expect(nerdamer('ilt(3*s/(4*s^2+5),s,t)').toString()).toEqual('(3/4)*cos((1/2)*sqrt(5)*t)');\r\n        expect(nerdamer('ilt(2/(3*s^2+1),s,t)').toString()).toEqual('2*sin((1/3)*sqrt(3)*t)*sqrt(3)^(-1)');\r\n        expect(nerdamer('ilt(5*sqrt(pi)/(3*s^(3/2)),s,t)').toString()).toEqual('(10/3)*sqrt(t)');\r\n        expect(nerdamer('ilt(3/(7*s^2+1)^2, s, t)').toString()).toEqual('(-3/14)*cos((1/7)*sqrt(7)*t)*t+(3/2)*sin((1/7)*sqrt(7)*t)*sqrt(7)^(-1)');\r\n        expect(nerdamer('ilt(5*s/(s^2+4)^2, s, t)').toString()).toEqual('(5/4)*sin(2*t) ing()).toEqual('[(1/2)*sqrt(16+4*e^(4*a^(-1))),(-1/2)*sqrt(16+4*e^(4*a^(-1)))]');\n        expect(nerdamer('solve(x/(x^2+2*x+1)+4,x)').toString()).toEqual('[(1/8)*sqrt(17)-9/8,(-1/8)*sqrt(17)-9/8]');\n        expect(nerdamer('solve((a*x^2+1),x)').toString()).toEqual('[a^(-1)*sqrt(-a),-a^(-1)*sqrt(-a)]');\n        expect(nerdamer('solve(sqrt(x)-2x+x^2,x)').toString()).toEqual('[(-1/2)*sqrt(5)+3/2,0,1,832040/2178309]');\n        expect(nerdamer('solve((2x+x^2)^2-x,x)').toString()).toEqual('[0,((-1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)+((1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)-4/3,(((-1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)+((1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)-4/3)*((1/2)*i*sqrt(3)+1/2),(((-1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)+((1/6)*sqrt(3)^(-1)*sqrt(59)+43/54)^(1/3)-4/3)*((1/2)*i*sqrt(3)+1/2)^2]');\n        expect(nerdamer('solve((5*x^4-2)/(x+1)/(x^2-1),x)').toString()).toEqual('[72425485/91070226,-72425485/91070226,(316684236/398209345)*i,(-316684236/398209345)*i]');\n        expect(nerdamer('solve(0=(x^(2)-2)/(e^(x)-1), x)').toString()).toEqual('[sqrt(2),-sqrt(2)]');\n        expect(nerdamer('solve(4/y^2=x^2+1,y)').toString()).toEqual('[(1/2)*(-1-x^2)^(-1)*sqrt(16+16*x^2),(-1/2)*(-1-x^2)^(-1)*sqrt(16+16*x^2)]');\n        expect(nerdamer('solve(1/(x+x^2), x)').toString()).toEqual('[]');\n        expect(nerdamer('solve(1/(x+x^2-1), x)').toString()).toEqual('[]');\n        expect(nerdamer('solve(-1+11000*(-100*(10+x)^(-1)+20)^(-2)*(10+x)^(-2), x)').toString()).toEqual('[(-1/2)*sqrt(110)-5,(1/2)*sqrt(110)-5]');\n        expect(nerdamer('solve(x^3+y^3=3, x)').toString()).toEqual('[((-1/2)*y^3+3/2+abs((-1/2)*y^3+3/2))^(1/3)+((-1/2)*y^3-abs((-1/2)*y^3+3/2)+3/2)^(1/3),(((-1/2)*y^3+3/2+abs((-1/2)*y^3+3/2))^(1/3)+((-1/2)*y^3-abs((-1/2)*y^3+3/2)+3/2)^(1/3))*((1/2)*i*sqrt(3)+1/2),(((-1/2)*y^3+3/2+abs((-1/2)*y^3+3/2))^(1/3)+((-1/2)*y^3-abs((-1/2)*y^3+3/2)+3/2)^(1/3))*((1/2)*i*sqrt(3)+1/2)^2]');\n        expect(nerdamer('solve(sqrt(10x+186)=x+9,x)').toString()).toEqual('
